 ('4', '23', 'en_gb', 'Health', 'Health', '<p>Eat vegetables!\r\n</p>', NULL, NULL, NULL, NULL, 'blue', NULL, NULL, NULL, NULL, NULL, 'row1', NULL, NULL, '2015-12-01 19:47:40', '2016-03-28 18:24:16', '9e26468b-51ee-4b2b-9e87-14eefeff5118'),
 ('5', '26', 'en_gb', 'Communication', 'Communication', '<p>Communication is good Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud.</p>', NULL, NULL, NULL, NULL, 'blue', NULL, NULL, NULL, NULL, NULL, 'row2', NULL, NULL, '2015-12-01 20:00:40', '2016-03-28 18:24:16', '6e934f04-7f98-445c-afac-e40b2ec9665e'),
 ('6', '28', 'en_gb', 'Relationships', 'Relationships', '<p>Relationships ar<strong>e a thing Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut. </strong><em>Q</em><em>uis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</em>\r\n</p>', NULL, NULL, NULL, NULL, 'red', NULL, NULL, NULL, NULL, NULL, 'row2', NULL, NULL, '2015-12-01 20:01:43', '2016-03-28 18:24:16', '650d0348-75d7-4190-b2c4-375afb4b3ed9'),
 ('7', '30', 'en_gb', NULL, NULL, NULL, '<p>Textbox Text <strong>Textbox </strong>TextTextbox\r\n TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox\r\n TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox\r\n TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox TextTextbox\r\n TextTextbox TextTextbox Text</p>', '', 'Section Heading', NULL, NULL, 'Textbox Heading', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-12-07 01:35:07', '2016-03-28 18:24:15', '318dbc6e-a0ff-499d-9f53-47266244c824'),
 ('19', '54', 'en_gb', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Left Heading', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam feugiat \r\nest eget arcu porttitor, id lobortis justo mattis. Integer fermentum \r\nsagittis nisi, in vehicula velit congue in. Nunc tristique rhoncus \r\neuismod. Cras mattis ex dictum, fermentum dui non, imperdiet erat. Nulla\r\n iaculis volutpat elit, et pulvinar lectus congue et. Donec posuere \r\nturpis vitae tortor tempor placerat.</p>', 'Right Heading', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec eget \r\nlacus et risus suscipit vestibulum ac eget orci. Fusce tellus nibh, \r\nlacinia sit amet enim nec, consequat convallis massa. Donec faucibus \r\nefficitur purus, eu mollis nunc laoreet sit amet. Vestibulum feugiat \r\nrisus eu diam faucibus interdum. Nullam iaculis nisl ornare odio rutrum \r\nporttitor. Proin mollis non erat eu aliquet.</p>', NULL, NULL, NULL, '2016-02-24 02:23:52', '2016-03-28 18:24:15', '191bcf33-cec3-477a-9d2a-e5a2045e3efe'),
 ('20', '55', 'en_gb', NULL, NULL, NULL, '<p>I am experienced at delivering PSHE lessons on a range of topics, including mental health & well-being; sex & relationships; the impact and influence of pornography; the media & sexualisation; anti-bullying; stress management; nutrition; physical activity; sexuality/challenging homophobia as well as money management.I can deliver one off lessons, a series of lessons, organise a PSHE day team delivery with a trusted team of colleagues or present at assemblies. Please contact me to discuss your requirements.</p><p><br>I work to up to date good practice and guidance on PSHE delivery in association with (links to PSHE Association / Sex Ed Forum etc)</p>', '', 'PSHE', NULL, NULL, 'PSHE', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-02-24 19:04:52', '2016-03-28 06:21:34', 'd4232ede-1492-4111-9b2b-a79ee9e93e84'),
 ('21', '56', 'en_gb', NULL, NULL, NULL, '<p>I am a self-employed educator, trainer, youth worker and facilitator. I have 15 years experience of working across a variety of areas and subjects including Public Health & Health Promotion; Behaviour Change; Motivational Interviewing; Youth work, Education and Social care covering a range of issues relating to health & well-being, specifically sexual health; drugs & alcohol and mental health and well-being. I plan and deliver presentations, training courses, workshops and lessons. I also produce teaching resources and health promotion materials, conduct needs assessments and small scale pieces of research. I am based in Sussex, but also work across the UK. </p><p><br>I am a member of MINT (Motivational Interviewing Network of Trainers) www.motivationalinterviewing.org.<br>As well as my extensive work with practitioners, I also work directly with young people, delivering lessons, workshops and 1-1 sesssions.  I currently work with The Young People\'s Centre in Brighton and the wider Youth Collective <a href=\"http://www.brightonandhoveyouthcollective.org.uk\">www.brightonandhoveyouthcollective.org.uk</a>  This is important to me to ensure my training courses are kept in line with current practice and the challenges and possibilities in this work.</p><p><br>My background is in the NHS, education and youth work.  I have a BA (Hons) in Education and MA in Health Promotion.  I currently work on a self-employed basis developing and providing high quality training, developing educational resources and conducting needs assessments and small scale research. I also directly deliver lessons and workshops to young people in schools, colleges and youth settings.</p><p><br>I have been an Associate Trainer for the FPA for the past 8 years.  I developed and deliver a one  day course \'Fantasy Vs Reality: the impact and influence of pornography on young people\'s sexual attitudes and behaviour\'.  I have also co-written and deliver \'The Pleasure Principle\' and \'Young people, sex and alcohol\' for the FPA.  If you are interested in booking on these courses, visit <a href=\"http://www.fpa.org.uk/training\">www.fpa.org.uk/training</a><br></p>', '', 'About', NULL, NULL, 'About', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-02-24 19:23:30', '2016-03-28 18:08:07', '224250c6-c8ac-40be-8cab-b2e7d2565b57'),
